import React from 'react';

export const BasicButton = (props) => {
    return(
        <div className={ props.disabled ? 'basicButton basicButton--disabled' : 'basicButton basicButton--enabled'} onClick={props.onClick}>
            <span>{props.label}</span>
        </div>
    );
};
